Alice, Cindy, Fenna, Lara, Leo, Maria, Paige

Are all those girls in class actually listening to their teachers or is their mind on something else altogether? We followed a couple of them after class and found out that geometry, algebra and history aren't really their most popular subject. However, some live lessons in biology is somthing they are all in for, especially when those lessons are given by some well hung studs!
